import React, { Component } from 'react'
import { Route } from "react-router-dom";
import  VerifiedAT1  from '../components/AT - Form/Verified/VerifiedAT1';
import { VerifiedAT2 } from '../components/AT - Form/Verified/VerifiedAT2';
import { VerifiedAT3 } from '../components/AT - Form/Verified/VerifiedAT3';
import { VerifiedAT4 } from '../components/AT - Form/Verified/VerifiedAT4';
import { VerifiedAT8 } from '../components/AT - Form/Verified/VerifiedAT8';
import { VerifiedAT5 } from '../components/AT - Form/Verified/VerifiedAT5';
import { VerifiedAT7 } from '../components/AT - Form/Verified/VerifiedAT7';

export class Verifiedatroute extends Component {
  render() {
    return (
      <div>
        <Route
          path={process.env.PUBLIC_URL + "/verifiedAT1"}
          exact={true}
          component={VerifiedAT1}
        />
         <Route
          path={process.env.PUBLIC_URL + "/VerifiedAT2"}
          exact={true}
          component={VerifiedAT2}
        />
         <Route
          path={process.env.PUBLIC_URL + "/VerifiedAT3"}
          exact={true}
          component={VerifiedAT3}
        />
        <Route
          path={process.env.PUBLIC_URL + "/VerifiedAT4"}
          exact={true}
          component={VerifiedAT4}
        />
         <Route
          path={process.env.PUBLIC_URL + "/VerifiedAT8"}
          exact={true}
          component={VerifiedAT8}
        />

        <Route
          path={process.env.PUBLIC_URL + "/VerifiedAT5"}
          exact={true}
          component={VerifiedAT5}
        />
        <Route
          path={process.env.PUBLIC_URL + "/VerifiedAT7"}
          exact={true}
          component={VerifiedAT7}
        />
      </div>
    )
  }
}

export default Verifiedatroute
